let htmlTemplate=`
<div class="import-container">
    <div class="import-content import rk-meisai-kadou hidden">
        <textarea id="valueContainer" rows="10" cols="60" placeholder="Paste text here!!!"></textarea>
    </div>
    <div class="import-feature import rk-meisai-redmine hidden">
        <form id="featureForm" class="contactForm" novalidate="novalidate">
        <h2 id="import-feature-status"></h2>
        <div class="row">
            <div class="col-md-12">
                <div class="form-group">
                    <input type="text" class="form-control" id="category" placeholder="Category" />
                </div>
            </div>
            <div class="col-md-12">
                <div class="form-group">
                    <input type="text" class="form-control" id="ticket" placeholder="ticket name" />
                </div>
            </div>
            <div class="col-md-12">
                <div class="form-group">
                    <input type="email" class="form-control" id="title" placeholder="title" />
                </div>
            </div>
            <div class="col-md-12">
                <div class="form-group">
                    <input type="text" class="form-control" id="feature" placeholder="feature" />
                </div>
            </div>
            <div class="col-md-12">
                <div class="form-group">
                    
                </div>
            </div>
        </div>
    </form>
    </div>
    <div class="import-footer">
        <div class="import hidden">
            <button class="btn-api-get rk-meisai-api">DL</button>
            <button class="btn-import-execute rk-meisai-kadou">Execute</button>
            <button class="btn-add-feature rk-meisai-redmine">Feature</button>
            <img width="30px" height="30px" src="data:image/png;base64," class="btn-collect-po rk-meisai-git"/>
        </div>
        <img width="30px" height="30px" src="data:image/png;base64," class="btn-import" style="margin:0 10px 0 -9px"/>
        <button class="btn-setting hidden">GetFeature</button>
    </div>
</div>
`;

var RKUI = {
    init: function() {
        $('body').append(htmlTemplate);
        var hnImport = /qc-portal.hdomain/;
        var hostname = document.location.hostname;
        if (hnImport.test(hostname)) {
            RKFeature.init()
        }
    },
    displayButton : function() {
        var hnAddFeature = /cl-redmine02.ssl.mdomain/;
        var hnImport = /qc-portal.hdomain/;
        var hnGit = /git01.mdomain/;
        var hnGithub = /github.com/;
        var hnApiGithub = /fuzzy-adventure-yr57l4q.pages.github.io/
        var hostname = document.location.hostname;
        $("[class*=rk-meisai-]").css({display: 'none'});
        
        if (hnAddFeature.test(hostname)) {
            $('.rk-meisai-redmine').css({display: ''});
            $('.btn-add-feature').click(function() {
                console.log("btn-add-feature");
                RKFeature.add();
            });
        }

        if (hnImport.test(hostname)) {
            $('.rk-meisai-kadou').css({display: ''});
            $('.btn-import-execute').click(function() {
                console.log("execute feature");
                RKApp.execute();
            });
        }

        if (hnGit.test(hostname) || hnGithub.test(hostname)) {
            $('.rk-meisai-git').css({display: ''});
            $('.btn-collect-po').click(function() {
                console.log("collect PO");
                if (hnGit.test(hostname)) {
                    RKPO.collect();
                }

                if (hnGithub.test(hostname)) {
                    RKGithubPO.collect();
                }
            });
        }

        if (hnApiGithub.test(hostname)) {
            $('.rk-meisai-api').css({display: ''});
            $('.btn-api-get').click(function() {
                console.log("download API");
                RKAPI.api();
            });
        }
    }
}
